import React from 'react'
import './styles.css' ; 
import {Line} from 'react-chartjs-2' ; 
const App = () => {
    return (
        <Line 
        data = {{
            labels:["Abhinav" , "UDK"] ,
            datasets:[
                {
                    data:[34090934 , 3409] , 
                    label:"Scores" , 
                    borderColor:"blue" , 
                    fill:true
                }
            ]
        }}
        />
    )
}

export default App
